import React, { Component } from 'react';

class AboutUs extends Component {
    state = {  }
    render() { 
        return ( 
            <div className="col-lg-4">
            <h1>Lettuce</h1>
            <p>Phyto Planet follows the highest standards in food safety. ANVISA, the Brazilian authority for food,
                follows international standards such
                as the European and American ones. 
                We are also registered in the FDA.</p>
        </div>
         );
    }
}

export default AboutUs;
